import './style.scss';

const Footer = () => {
    return(
        <footer id="footer">
            <div className="container">
                <div className="row">
                    <div className="col-md-12">
                        <div className="col-md-6">
                            <h4 className="bold">Siga nossas redes sociais</h4>
                        </div>

                        <div className="col-md-6">

                        </div>
                    </div>
                </div>
            </div>
        </footer>
    )
}

export default Footer;
